INSERT INTO `ps_product_lang` VALUES (282,1,1,'Chcesz włożyć swoją ulubioną weekendową bluzę z kapturem, która zapewnia Ci ciepło i wygodę, ale zależy Ci też na eleganckim wyglądzie? Bluza z kapturem Nike Tech Fleece ma lekką konstrukcję z niezbyt grubego materiału, dzięki czemu daje ciepło, nie powodując zbytniego obciążenia. Możesz ją swobodnie włożyć zarówno do relaksu w domu, jak i na czas dojazdu do pracy.\nPrezentowany kolor: Czerń/Dark Grey Heather/Biel\nStyl: CU4489-016','Chcesz włożyć swoją ulubioną weekendową bluzę z kapturem, która zapewnia Ci ciepło i wygodę, ale zależy Ci też na eleganckim wyglądzie? Bluza z kapturem Nike Tech Fleece ma lekką konstrukcję z niezbyt grubego materiału, dzięki czemu daje ciepło, nie powodując zbytniego obciążenia','nike-sportswear-tech-fleece','Chcesz włożyć swoją ulubioną weekendową bluzę z kapturem, która zapewnia Ci ciepło i wygodę, ale zależy Ci też na eleganckim wyglądzie? Bluza z kapturem Nike Tech Fleece ma lekką konstrukcję z niezbyt grubego materiału, dzięki czemu daje ciepło, nie powodując zbytniego obciążenia','','Nike Sportswear Tech Fleece','Nike Sportswear Tech Fleece','','','',''),(283,1,1,'Model Air Jordan 1 Hi FlyEase łączy w sobie upragniony styl pierwszych butów sygnowanych przez Michaela Jordana z prostą konstrukcją zakładaną z użyciem jednej ręki. Nie ma sznurówek do wiązania – indywidualne dopasowanie zapewnia zamek otaczający stopę i dwa paski.\nPrezentowany kolor: Biel/Gym Red/Biel/Czerń\nStyl: CQ3835-106','Model Air Jordan 1 Hi FlyEase łączy w sobie upragniony styl pierwszych butów sygnowanych przez Michaela Jordana z prostą konstrukcją zakładaną z użyciem jednej ręki','air-jordan-1-hi-flyease','Model Air Jordan 1 Hi FlyEase łączy w sobie upragniony styl pierwszych butów sygnowanych przez Michaela Jordana z prostą konstrukcją zakładaną z użyciem jednej ręki','','Air Jordan 1 Hi FlyEase','Air Jordan 1 Hi FlyEase','','','',''),(284,1,1,'Wyróżniają się kolorami retro i stylowym wyglądem. Ta para butów ma cholewkę ze skóry nubukowej i zamszu, dzięki czemu zapewnia miękkość i wygodę. Nike Air w podeszwie odpowiada za lekkość na każdym kroku.\nPrezentowany kolor: Czerń/Cardinal Red/Biel/Vivid Orange\nStyl: FJ4923-008','Wyróżniają się kolorami retro i stylowym wyglądem','air-jordan-1-mid-se','Wyróżniają się kolorami retro i stylowym wyglądem','','Air Jordan 1 Mid SE','Air Jordan 1 Mid SE','','','',''),(286,1,1,'Model Air Max Plus 3 czerpie to, co najlepsze od minionych pokoleń. Nawiązuje do dziedzictwa Air i w subtelny sposób oddaje hołd swoim poprzednikom. Miękka pianka i poduszki gazowe Max Air zapewniają sprawdzoną sprężystość i wygodę przy każdym kroku. Futurystyczne wzornictwo i gradientowe neutralne kolory kontrastujące z gumową podeszwą przyciągają uwagę i nadają temu modelowi współczesny styl.\nPrezentowany kolor: Czerń/Light Orewood Brown/Anthracite/Smoke Grey\nStyl: FV0386-001','Model Air Max Plus 3 czerpie to, co najlepsze od minionych pokoleń','nike-air-max-plus-3','Model Air Max Plus 3 czerpie to, co najlepsze od minionych pokoleń','','Nike Air Max Plus 3','Nike Air Max Plus 3','','','',''),(287,1,1,'Buty męskie Nike Air Max Plus nawiązują do legendarnej poduszki gazowej Tuned Air i dynamicznego wyglądu modelu z 1998 roku.\nPrezentowany kolor: Czerń/Czerń/Czerń\nStyl: AJ2029-001','Buty męskie Nike Air Max Plus nawiązują do legendarnej poduszki gazowej Tuned Air i dynamicznego wyglądu modelu z 1998 roku','nike-air-max-plus','Buty męskie Nike Air Max Plus nawiązują do legendarnej poduszki gazowej Tuned Air i dynamicznego wyglądu modelu z 1998 roku','','Nike Air Max Plus','Nike Air Max Plus','','','',''),(288,1,1,'Skarpety Nike są wykonane z lekkiego, gładkiego materiału, dzięki czemu zapewniają długotrwałą wygodę, dopasowanie i wsparcie przez cały trening.\nPrezentowany kolor: Czerń/Biel\nStyl: SX4926-001','Skarpety Nike są wykonane z lekkiego, gładkiego materiału, dzięki czemu zapewniają długotrwałą wygodę, dopasowanie i wsparcie przez cały trening','nike','Skarpety Nike są wykonane z lekkiego, gładkiego materiału, dzięki czemu zapewniają długotrwałą wygodę, dopasowanie i wsparcie przez cały trening','','Nike','Nike','','','',''),(289,1,1,'Idealne związki ponoć nie istnieją, ale to połączenie prawie osiągnęło doskonałość. Klasyczne buty AJ1 są wyposażone w najbardziej kultowy element zaczerpnięty z modelu AJ3 – doskonale wiecie, jaki – co udowadnia, że co dwie legendy, to nie jedna. Odcienie czerni, bieli i szarości tworzą nowoczesną, neutralną kolorystykę, która będzie pasować do wszystkiego, a materiały świetnej jakości zapewniają wygodę noszenia. Sto lat nowej parze!\nPrezentowany kolor: Tech Grey/Czerń/Biel/Muslin\nStyl: DZ5485-052','Idealne związki ponoć nie istnieją, ale to połączenie prawie osiągnęło doskonałość','air-jordan-1-retro-high-og','Idealne związki ponoć nie istnieją, ale to połączenie prawie osiągnęło doskonałość','','Air Jordan 1 Retro High OG','Air Jordan 1 Retro High OG','','','',''),(290,1,1,'Potrzebujesz bluzy z kapturem o prostym fasonie, która będzie świetnie wyglądać? Oto ona. Jest wykonana z miękkiej dzianiny, która jest gładka na zewnątrz i miękka po stronie wewnętrznej, dzięki czemu zapewnia wygodę i ciepło przez cały dzień.\nPrezentowany kolor: Carbon Heather/Biel\nStyl: FJ7774-091','Potrzebujesz bluzy z kapturem o prostym fasonie, która będzie świetnie wyglądać? Oto ona','jordan-essentials','Potrzebujesz bluzy z kapturem o prostym fasonie, która będzie świetnie wyglądać? Oto ona','','Jordan Essentials','Jordan Essentials','','','',''),(292,1,1,'Ta wersja o średnim profilu jest inspirowana oryginalnym modelem AJ1 i zachowuje jego kultowy wygląd. Kolory i wyrazista skóra nadają jej wyjątkowy charakter.\nPrezentowany kolor: Biel/Czerń/Gym Red\nStyl: DQ8426-106','Ta wersja o średnim profilu jest inspirowana oryginalnym modelem AJ1 i zachowuje jego kultowy wygląd','air-jordan-1-mid','Ta wersja o średnim profilu jest inspirowana oryginalnym modelem AJ1 i zachowuje jego kultowy wygląd','','Ai