 sobie odmówić jeszcze jednego meczu. Ten specjalny model oddaje hołd długiej i krętej podróży KD oraz umiejętności pokonywania wszelkich przeszkód na drodze.\nPrezentowany kolor: Deep Royal/Metallic Silver/Hyper Royal/Vivid Purple\nStyl: DV2917-401','Kevin Durant to prawdziwy miłośnik koszykówki','kd16','Kevin Durant to prawdziwy miłośnik koszykówki','','KD16','KD16','','','',''),(433,1,1,'Kibicuj swojej drużynie z wygodą i stylem. Szenilowy materiał jest nie tylko miękki, ale też stylowo wygląda, a dzięki elastycznym włóknom opaska jest cały czas na swoim miejscu bez względu na to, czy trenujesz, czy miło spędzasz czas z przyjaciółmi.\nPrezentowany kolor: Czerń/Silver/Biel\nStyl: FB1403-093','Kibicuj swojej drużynie z wygodą i stylem','paris-saint-germain','Kibicuj swojej drużynie z wygodą i stylem','','Paris Saint-Germain','Paris Saint-Germain','','','',''),(434,1,1,'Wkrocz w lata 80. z butami Air Alpha Force. Ten fason retro, w komplecie z personalizowanym paskiem, wygląda tak samo dobrze na boisku, jak i na ulicy.\nPrezentowany kolor: Czerń/Guava Ice/Pomarańczowy/Czerń\nStyl: FN6594-002','Wkrocz w lata 80','nike-air-alpha-force-88','Wkrocz w lata 80','','Nike Air Alpha Force 88','Nike Air Alpha Force 88','','','',''),(435,1,1,'Założyciel i dyrektor kreatywny firmy Alyx, Matthew M. Williams, jest znany z innowacyjnego podejścia do mody, które pozwala mu wytyczać nowe kierunki. Jego idea jest prosta – łączy doświadczenia swojego życia w Nowym Jorku i Kalifornii z najnowszymi innowacjami. Model Nike x MMW 005 powstał w myśl tej koncepcji oraz sprawdzi się podczas ćwiczeń na macie i nie tylko.\nPrezentowany kolor: Dark Khaki/Dark Khaki/Dark Khaki\nStyl: DH1258-200','Założyciel i dyrektor kreatywny firmy Alyx, Matthew M','nike-x-mmw-005','Założyciel i dyrektor kreatywny firmy Alyx, Matthew M','','Nike x MMW 005','Nike x MMW 005','','','',''),(436,1,1,'Weź sprawy w swoje ręce i nadaj wyjątkowy charakter tej koszykarskiej, ulicznej ikonie. Personalizowana konstrukcja 