ia przechowywanie telefonu podczas biegu bez użycia rąk','','Nike Lean','Nike Lean','','','',''),(442,1,1,'Ten klasyczny, puchowy bezrękawnik zapewni Ci ciepło. Ma izolację PrimaLoft® Thermoplume i jest wykonany z wodoodpornego materiału rip-stop, dzięki czemu chroni przed zimnem w chłodne, deszczowe dni. Możesz go założyć na ulubioną koszulę flanelową lub bluzę z kapturem i stawić czoła chłodom.\nPrezentowany kolor: Czerń/Biel\nStyl: FB7373-010','Ten klasyczny, puchowy bezrękawnik zapewni Ci ciepło','nike-sportswear-club-primaloft','Ten klasyczny, puchowy bezrękawnik zapewni Ci ciepło','','Nike Sportswear Club PrimaLoft®','Nike Sportswear Club PrimaLoft®','','','',''),(443,1,1,'Klasyczna koszulka polo NikeCourt Dri-FIT ma potencjał, aby stać się Twoim ulubionym modelem. Jej materiał, wykonany w 100% z włókien poliestru z recyklingu, ma pikowaną fakturę, która nadaje całości stylowy charakter.\nPrezentowany kolor: Czerń/Biel\nStyl: DD8372-010','Klasyczna koszulka polo NikeCourt Dri-FIT ma potencjał, aby stać się Twoim ulubionym modelem','nikecourt-dri-fit','Klasyczna koszulka polo NikeCourt Dri-FIT ma potencjał, aby stać się Twoim ulubionym modelem','','NikeCourt Dri-FIT','NikeCourt Dri-FIT','','','',''),(444,1,1,'Produkty do noszenia na co dzień powinny być eleganckie i proste. Ta świetna koszulka z długim rękawem jest wykonana z najwyższej jakości bawełny o luźnym kroju. Wyszywane logo Air Jordan nadaje minimalistyczny wygląd, a jednocześnie pozwala reprezentować najlepszych.\nPrezentowany kolor: Pine Green\nStyl: FJ0702-302','Produkty do noszenia na co dzień powinny być eleganckie i proste','jordan-wordmark','Produkty do noszenia na co dzień powinny być eleganckie i proste','','Jordan Wordmark','Jordan Wordmark','','','',''),(445,1,1,'Wytrzymała gumowa powłoka zewnętrzna sprawdza się podczas aktywności na świeżym powietrzu, a głębokie rowki dają optymalną kontrolę. Nic Cię nie zatrzyma – wyjdź i graj.\nPrezentowany kolor: Cement Grey/Biel/Czerń/Fire Red\nStyl: FB2302-049','Wytrzymała gumowa powłoka zewnętrzna sprawdza się podczas aktywności na świeżym powietrzu, a głębokie rowki dają optymalną kontrolę','jordan-playground-20-8p','Wytrzymała gumowa powłoka zewnętrzna sprawdza się podczas aktywności na świeżym powietrzu, a głębokie rowki dają optymalną kontrolę','','Jordan Playground 2.0 8P','Jordan Playground 2.0 8P','','','',''),(446,1,1,'Buty Jordan 4 ADG, stworzone na prośbę samego MJ-a, to klasyczny fason inspirowany stylem retro Jordan. Miękka skóra licowa i kultowy nadruk imitujący skórę słonia na pięcie. Gumowa podeszwa ma bieżnik, który łączy przyczepność z uniwersalnością i wygodą, której potrzebujesz. Ten produkt stworzony wspólnie z marką Eastside Golf wyraża miłość do obu gier.\nPrezentowany kolor: Czerń/Biel/Metallic Gold/Malachite\nStyl: FJ0850-001','Buty Jordan 4 ADG, stworzone na prośbę samego MJ-a, to klasyczny fason inspirowany stylem retro Jordan','jordan-adg-4-x-eastside-golf','Buty Jordan 4 ADG, stworzone na prośbę samego MJ-a, to klasyczny fason inspirowany stylem retro Jordan','','Jordan ADG 4 x Eastside Golf','Jordan ADG 4 x Eastside Golf','','','',''),(447,1,1,'Po opanowaniu podstaw wynieś swoje umiejętności na wyższy poziom. Klasyczny, tradycyjny krój i materiał odprowadzający wilgoć zapewniają uczucie ochłody, gdy trening nabiera tempa.\nPrezentowany kolor: Cool Grey/Cool Grey/Czerń/Mint Foam\nStyl: DZ1335-066','Po opanowaniu podstaw wynieś swoje umiejętności na wyższy poziom','chelsea-fc-academy-pro-trzecia-wersja','Po opanowaniu podstaw wynieś swoje umiejętności na wyższy poziom','','Chelsea FC Academy Pro (trzecia wersja)','Chelsea FC Academy Pro (trzecia wersja)','','','',''),(448,1,1,'Ten plecak to idealny wybór dla prawdziwych MVP. Ma wszystko, czego potrzeba, aby wygodnie przenosić potrzebne rzeczy przez cały dzień. Obszerna przegroda główna zawiera kieszeń na laptop, dwie kieszenie zapinane na zamek z przodu umożliwiają szybki dostęp do drobiazgów, których nie chcesz zgubić, a boczne kiesze