/23 (wersja domowa)','','','',''),(1476,1,1,'Spodenki Nike NBA Swingman Dallas Mavericks Icon Edition są inspirowane autentycznymi spodenkami noszonymi przez zawodników NBA. Są wykonane z materiału odprowadzającego wilgoć i mają boczne kieszenie z siateczki zapewniające łatwy dostęp do przechowywanej zawartości. Detale nawiązują do boiskowego stylu ulubionej drużyny. Ten produkt jest wykonany w 100% z włókien poliestru z recyklingu.\nPrezentowany kolor: Game Royal/College Navy/Flat Silver/Biel\nStyl: AJ5599-480','Spodenki Nike NBA Swingman Dallas Mavericks Icon Edition są inspirowane autentycznymi spodenkami noszonymi przez zawodników NBA','dallas-mavericks-icon-edition','Spodenki Nike NBA Swingman Dallas Mavericks Icon Edition są inspirowane autentycznymi spodenkami noszonymi przez zawodników NBA','','Dallas Mavericks Icon Edition','Dallas Mavericks Icon Edition','','','',''),(1477,1,1,'Wszystkie ślady historii prowadzą do Bostonu. Od kultowych graczy z początków tego sportu po współczesnych mistrzów – ewolucja Celtics obejmuje epoki, mistrzostwa oraz pokolenia fanów i fanek. Strój drużyny z kolekcji City Edition 2023/24 nawiązuje do początków koszykówki i nieustającego zaangażowania wszystkich osób mających ten sport w sercu.\nPrezentowany kolor: Sail/Gorge Green\nStyl: DX8695-133','Wszystkie ślady historii prowadzą do Bostonu','boston-celtics-city-edition-2023-24','Wszystkie ślady historii prowadzą do Bostonu','','Boston Celtics City Edition 2023/24','Boston Celtics City Edition 2023/24','','','',''),(1478,1,1,'Ten model Kobe 6 Protro bazuje na pożądanej kolorystyce z 2010 roku, która zyskała zupełnie nowe wydanie. Elegancka i łuskowata cholewka w odcieniu Bright Crimson współgra z elektryzującymi zielonymi akcentami i wężowym wzorem inspirowanym pseudonimem Kobe\'ego „Black Mamba”. Buty są wyposażone w elastyczną poduszkę gazową Zoom Air i dynamiczną piankę, a dzięki zmniejszonemu wzorowi bieżnika udało nam się uzyskać lepsze czucie podłoża i mniejszą wagę. To model, który daje z siebie wszystko, co najlepsze.\nPrezentowany kolor: Bright Crimson/Electric Green/Czerń\nStyl: FV4921-600','Ten model Kobe 6 Protro bazuje na pożądanej kolorystyce z 2010 roku, która zyskała zupełnie nowe wydanie','kobe-6-protro','Ten model Kobe 6 Protro bazuje na pożądanej kolorystyce z 2010 roku, która zyskała zupełnie nowe wydanie','','Kobe 6 Protro','Kobe 6 Protro','','','',''),(1479,1,1,'Nasza kolekcja City Edition celebruje więź między zawodnikami a miastem, które nazywają domem. Koszulka jest inspirowana kultowymi symbolami miasta i dawnymi strojami Utah Jazz oraz podkreśla wyjątkowe kultury, społeczności i historię, które wyróżniają Salt Lake City.\nPrezentowany kolor: Czerń\nStyl: FN1182-010','Nasza kolekcja City Edition celebruje więź między zawodnikami a miastem, które nazywają domem','utah-jazz-city-edition','Nasza kolekcja City Edition celebruje więź między zawodnikami a miastem, które nazywają domem','','Utah Jazz City Edition','Utah Jazz City Edition','','','',''),(1480,1,1,'Odprowadzająca wilgoć koszulka Strike sprawdzi się na boisku i poza nim. Ten lekki, elastyczny i przewiewny model jest podobny do tego, który zawodnicy noszą podczas gry, dzięki czemu możesz dać z siebie wszystko podczas podań, dryblowania i strzelania bramek.\nPrezentowany kolor: Pure Platinum/Volt/Barely Volt/Hyper Pink\nStyl: DV9237-043','Odprowadzająca wilgoć koszulka Strike sprawdzi się na boisku i poza nim','nike-dri-fit-strike','Odprowadzająca wilgoć koszulka Strike sprawdzi się na boisku i poza nim','','Nike Dri-FIT Strike','Nike Dri-FIT Strike','','','',''),(1481,1,1,'Wybierz spodenki Tech Fleece i postaw na wygodę oraz luźny styl przez cały dzień. Nasza wysokiej jakości, gładka po obu stronach dzianina jest cieplejsza i miększa niż kiedykolwiek i jednocześnie ma tę samą lekką konstrukcję, którą kochasz. Te wygodne luźne spodenki powyżej kolan mają też charakterystyczne detale Tech Fleece, które nadają stylizacji elegancki wygląd. Aby stworzyć jednolitą stylizację, spodenki połącz z T-shirtem lub bluzą z kapturem Tech Fleece.\nPrezentowany kolor: Medium Olive/Czerń\nStyl: FB8171-222','Wybierz spodenki Tech Fleece i postaw na wygodę oraz luźny styl przez cały dzień','nike-sportswear-tech-fleece','Wybierz spodenki Tech Fleece i postaw na wygodę oraz luźny styl przez cały dzień','','Nike Sportswear Tech Fleece','Nike Sportswear Tech Fleece','','','',''),(1482,1,1,'Nasza kolekcja Standard Issue łączy sportowy styl vintage z nowoczesną funkcjonalnością, a te luźne spodnie PSG nie są wyjątkiem. Są wykonane z przewiewnej dzianiny dresowej z technologią odprowadzania wilgoci, dzięki czemu zapewniają uczucie suchości i wygodę podczas kibicowania ulubionej drużynie.\nPrezentowany kolor: Midnight Navy/University Red\nStyl: DV4997-410','Nasza kolekcja Standard Issue łączy sportowy styl vintage z nowoczesną funkcjonalnością, a te luźne spodnie PSG nie są wyjątkiem','paris-saint-germain-standard-issue','Nasza kolekcja Standard Issue łączy sportowy styl vintage z nowoczesną funkcjonalnością, a te luźne spodnie PSG nie są wyjątkiem','','Paris Saint-Germain Standard Issue','Paris Saint-Germain Standard Issue','','','',''),(1483,1,1,'Nie pozwól, aby chłód pokrzyżował Ci plany. Niezależnie od tego, czy aktywnie spędzasz czas na zewnątrz, czy potrzebujesz komfortu w domu, komin z miękkiej dzianiny Polartec® zapewni Ci wygodę i ciepło. Regulowany sznurek pozwala dostosować dopasowanie do Twoich potrzeb.\nPrezentowany kolor: Stone/Iron Grey\nStyl: FV5707-206','Nie pozwól, aby chłód pokrzyżował Ci plany','jordan-paris','Nie pozwól, aby chłód pokrzyżował Ci plany','','Jordan Paris','Jordan Paris','','','',''),(1484,1,1,'Te skarpety sięgające poniżej kostki zapewniają wygodę na co dzień. Dzięki świetnej przewiewności i odprowadzaniu wilgoci stopy pozostają suche i nie nagrzewają się podczas intensywnego dnia.\nPrezentowany kolor: Wielokolorowe\nStyl: DX9656-911','Te skarpety sięgające poniżej kostki zapewniają wygodę na co dzień','jordan','Te skarpety sięgające poniżej kostki zapewniają wygodę na co dzień','','Jordan','Jordan','','','',''),(1485,1,1,'Dzięki naszej kurtce Axis Performance System z powodzeniem odbędziesz każdy trening nawet w burzowe dni. Można ją założyć na bluzę i bieliznę, aby ochronić się przed żywiołami. Jest lekka i ma regulowane elementy (takie jak kaptur i obszycie z tyłu), dzięki czemu będziesz w gotowości do treningu w każdej chwili, niezależnie od pogody.\nPrezentowany kolor: Czerń/Biel\nStyl: DQ6640-010','Dzięki naszej kurtce Axis Performance System z powodzeniem odbędziesz każdy trening nawet w burzowe dni','nike-storm-fit-adv-aps','Dzięki naszej kurtce Axis Performance System z powodzeniem odbędziesz każdy trening nawet w burzowe dni','','Nike Storm-FIT ADV A.P.S.','Nike Storm-FIT ADV A.P.S.','','','',''),(1486,1,1,'Oto kapelusz Nike Apex, którego brakowało w Twojej garderobie. Nigdy nie wydawało Ci się, że go potrzebujesz – aż dotąd. Konstrukcja o średniej głębokości jest wykonana z miękkiego diagonalu i ozdobiona wyszywanym, kontrastowym logo Swoosh na wstawce z przodu, które nadaje całości stylowy wygląd Nike. Daszek otaczający głowę daje pełną osłonę, dzięki czemu pozwala zachować świeżość w każdą pogodę.\nPrezentowany kolor: Czerń/Biel\nStyl: FB5382-010','Oto kapelusz Nike Apex, którego brakowało w Twojej garderobie','nike-apex','Oto kapelusz Nike Apex, którego brakowało w Twojej garderobie','','Nike Apex','Nike Apex','','','',''),(1487,1,1,'Zabierz ze sobą na trening piłkę, która pomoże Ci doskonalić umiejętności. Trwała, zszywana powłoka zapewnia doskonałe czucie piłki. Gumowa dętka bardzo długo utrzymuje powietrze i kształt, więc nie musisz się już martwić o ciągłe dopompowywanie piłki.\nPrezentowany kolor: Żółć/Fiolet/Magenta\nStyl: FB2975-710','Zabierz ze sobą na trening piłkę, która pomoże Ci doskonalić umiejętności','nike-skills','Zabierz ze sobą na trening piłkę, która pomoże Ci doskonalić umiejętności','','Nike Skills','Nike Skills','','','',''),(1488,1,1,'